/* eslint-disable no-use-before-define */
import React from "react";
import TextField from "@material-ui/core/TextField";
import Autocomplete from "@material-ui/lab/Autocomplete";
import InputAdornment from "@material-ui/core/InputAdornment";
import SearchIcon from "@material-ui/icons/Search";

const searchData = [
  "Salem Community Fridge",
  "Salisbury Fridge",
  "Sheffield Fridge",
  "Springfield Community Fridge",
  "Somerville Community Fridge",
  "Somerset Community Fridge",
  "Southampton Fridge",
  "Southwick Fridge",
  "South End Fridge",
  "South Hadley Community Fridge",
];

export default function CoreSearchBar() {
  return (
    <div style={{ width: 400 }}>
      <Autocomplete
        freeSolo
        options={searchData}
        renderInput={(params) => (
          <TextField
            {...params}
            variant="outlined"
            placeholder="Search for a fridge"
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon />
                </InputAdornment>
              ),
              ...params.InputProps,
            }}
          />
        )}
      />
    </div>
  );
}
